// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract Voting {
    struct Candidate {
        string name;
        uint voteCount;
    }

    mapping(string => bool) private candidateExists;
    Candidate[] public candidates;
    
    mapping(address => bool) public registeredVoters;  // Who can vote
    mapping(address => bool) public hasVoted;  // Who has already voted
    address[] public voters;  // Store all voter addresses

    function addCandidate(string memory _name) public {
        require(!candidateExists[_name], "Candidate already exists.");
        candidates.push(Candidate(_name, 0));
        candidateExists[_name] = true;
    }

    function registerVoter(address _voter) public {
        require(!registeredVoters[_voter], "Voter is already registered.");
        registeredVoters[_voter] = true;
        voters.push(_voter);
    }

    function vote(string memory _name) public {
        require(registeredVoters[msg.sender], "You are not a registered voter.");
        require(!hasVoted[msg.sender], "You have already voted.");
        require(candidateExists[_name], "Candidate does not exist.");

        for (uint i = 0; i < candidates.length; i++) {
            if (keccak256(bytes(candidates[i].name)) == keccak256(bytes(_name))) {
                candidates[i].voteCount++;
                hasVoted[msg.sender] = true;
                break;
            }
        }
    }

    function getVoter(uint index) public view returns (address) {
        require(index < voters.length, "Index out of bounds.");
        return voters[index];
    }

    function getTotalVoters() public view returns (uint) {
        return voters.length;
    }
}
